package com.redhat.coolstore.service;

import java.util.List;
import java.util.logging.Logger;

import jakarta.inject.Inject; // Replaced javax.inject with jakarta.inject

import jakarta.persistence.criteria.CriteriaBuilder;
import jakarta.persistence.criteria.CriteriaQuery;
import jakarta.persistence.criteria.Root;

import io.quarkus.hibernate.orm.panache.PanacheEntityBase;

import jakarta.enterprise.context.ApplicationScoped;

import jakarta.persistence.EntityManager;

import com.redhat.coolstore.model.*;

import io.quarkus.hibernate.orm.panache.runtime.JpaOperations;

@ApplicationScoped
public class CatalogService {

    @Inject
    Logger log;

    @Inject
    private EntityManager em;

    public CatalogService() {
    }

    public List<CatalogItemEntity> getCatalogItems() {
        CriteriaBuilder cb = em.getCriteriaBuilder();
        CriteriaQuery<CatalogItemEntity> criteria = cb.createQuery(CatalogItemEntity.class);
        Root<CatalogItemEntity> member = criteria.from(CatalogItemEntity.class);
        criteria.select(member);
        return em.createQuery(criteria).getResultList();
    }

    public CatalogItemEntity getCatalogItemById(String itemId) {
        return em.find(CatalogItemEntity.class, itemId);
    }

    @io.quarkus.hibernate.orm.panache.runtime.JpaOperations
    public void updateInventoryItems(String itemId, int deducts) {
        InventoryEntity inventoryEntity = getCatalogItemById(itemId).getInventory();
        int currentQuantity = inventoryEntity.getQuantity();
        inventoryEntity.setQuantity(currentQuantity-deducts);
        em.merge(inventoryEntity);
    }

}
```

## Additional Information

Note that we've replaced the `@Transactional` annotation with `@io.quarkus.hibernate.orm.panache.runtime.JpaOperations`. This annotation is used to enable transactional behavior for the `updateInventoryItems` method.

